{
	"openapi": "3.0.1",
	"servers": [
		{
			"description": "API para o cadastro de fatura de frete no SIGAGFE - TOTVS",
			"url": "{{host}}/api/gfe/v1",
			"variables": {
				"serverUrl": {
					"default": "localhost"
				},
				"serverHttpPort": {
					"default": "8080"
				}
			}
		}
	],
	"info": {
		"description": "API para o cadastro de fatura de frete no SIGAGFE - TOTVS",
		"version": "1.000",
		"title": "FreightInvoices",
		"contact": {
			"name": "T-Talk",
			"url": "API.Totvs.com.br",
			"email": "comiteintegracao@totvs.com.br"
		},
		"x-totvs": {
			"messageDocumentation": {
				"name": "FreightInvoices",
				"description": "Cadastro da fatura de frete.",
				"segment": "Gestão de Frete Embarcador"
			},
			"productInformation": [
				{
					"product": "Protheus",
					"contact": "comiteintegracao@totvs.com.br",
					"description": "Cadastro da fatura de frete.",
					"adapter": "gfea070api.prw",
					"helpUrl": "link aqui"
				}
			]
		}
	},
	"paths": {
		"/FreightInvoices": {
			"get": {
				"tags": [
					"FreightInvoices"
				],
				"summary": "Retorna todas as faturas de frete cadastradas.",
				"x-totvs": {
					"productInformation": [
						{
							"product": "Protheus",
							"available": true,
							"minimalVersion": "12.1.30"
						}
					]
				},
				"description": "Retorna todas as faturas de frete cadastradas.",
				"operationId": "getFreightInvoices",
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Order"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Page"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/PageSize"
					}
				],
				"responses": {
					"200": {
						"description": "Operação realizada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/FreightInvoices_1_000.json#/definitions/PagedFreightInvoices"
								}
							}
						}
					},
					"400": {
						"description": "Erro no momento da requisição",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		},
		"/FreightInvoices/{InternalId}": {
			"get": {
				"tags": [
					"InternalId"
				],
				"summary": "Retorna uma fatura de frete.",
				"description": "Retorna apenas uma fatura de frete, requerida através da chave do registro (InternalId).",
				"operationId": "getFreightInvoicesID",
				"x-totvs": {
					"productInformation": [
						{
							"product": "Protheus",
							"available": true,
							"minimalVersion": "12.1.30"
						}
					]
				},
				"parameters": [
					{
						"$ref": "#/components/parameters/InternalId"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"responses": {
					"200": {
						"description": "Operação realizada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/FreightInvoices_1_000.json#/definitions/FreightInvoicesType"
								}
							}
						}
					},
					"404": {
						"description": "Erro no momento da requisição",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			},
			"put": {
				"tags": [
					"InternalId"
				],
				"summary": "Altera a situação de uma fatura de frete.",
				"description": "Altera a situação da fatura de frete informada através da chave (InternalId).",
				"operationId": "putFreightInvoicesID",
				"x-totvs": {
					"productInformation": [
						{
							"product": "Protheus",
							"available": true,
							"note": "Este verbo esta disponível com todos os parâmetros",
							"minimalVersion": "12.1.30"
						}
					]
				},
				"parameters": [
					{
						"$ref": "#/components/parameters/InternalId"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"requestBody": {
					"description": "Altera a situação da fatura de frete informada.",
					"content": {
						"application/json": {
							"schema": {
								"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/FreightInvoices_1_000.json#/definitions/FreightInvoicesType"
							}
						}
					}
				},
				"responses": {
					"200": {
						"description": "Operação realizada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/FreightInvoices_1_000.json#/definitions/FreightInvoicesType"
								}
							}
						}
					},
					"400": {
						"description": "Erro no momento da operação.",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					},
					"404": {
						"description": "Fatura não localizada",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		}
	},
	"components": {
		"parameters": {
			"InternalId": {
				"name": "InternalId",
				"in": "path",
				"required": true,
				"description": "Chave do registro.",
				"schema": {
					"type": "string"
				}
			}
		},
		"schemas": {}
	}
}
